import React, { useState } from "react";
import "./MatchingResultPage.css";
import { Link } from "react-router-dom";

const MatchingResultPage = () => {
  const [showMoreResults, setShowMoreResults] = useState(false);

  // 샘플 매칭 결과 데이터 (실제 데이터에 대한 대체 예시입니다)
  const matchingResults = [
    "매칭 결과 1",
    "매칭 결과 2",
    "매칭 결과 3",
    "매칭 결과 4",
    "매칭 결과 5",
    "매칭 결과 6",
    "매칭 결과 7",
  ];

  const visibleResults = showMoreResults ? matchingResults : matchingResults.slice(0, 5);

  return (
    <div className="matchingresultpage">
      {/* ... 이전 코드 ... */}
      {visibleResults.map((result, index) => (
        <div key={index} className="matchingresult">
          {result}
        </div>
      ))}
      {matchingResults.length > 5 && !showMoreResults && (
        <div className="show-more-results" onClick={() => setShowMoreResults(true)}>
          더 많은 매칭 결과 보기
        </div>
      )}
    </div>
  );
};

export default MatchingResultPage;
